children.script:
var registerSa = () => {
    lgSa.lgSaRegister({
        user_id: window.app_user_id
    });
};
registerSa()

if (lgSa.platTrack) {
    const trackData = { page_id: '1rxr' }
    lgSa.platTrack('h5pv', trackData);
}

let noImage = document.querySelector('.ng-image')
noImage.style.pointerEvents = 'none'
let timer = null
let startTime = ''
let endTime = ''
const that = this
this.$el.addEventListener('touchstart', function () {
  startTime = +new Date()
  timer = setTimeout(function () {
    document.getElementById('q15BaVj7').click()
  }, 700)
})

this.$el.addEventListener('touchend', function () {
  endTime = +new Date()
  clearTimeout(timer)
})

if (lgSa.platTrack) {
    function setTrack(el, callback) {
        if (el.addEventListener) {
            el.addEventListener('click', callback, false);
        } else if (el.attachEvent) {
            el.attachEvent('onclick', callback);
        }
    }
    const list = Array.from(document.querySelectorAll('.share-content ul li'))
    for (let i = 0; i < list.length; i++) {
        const element = list[i];
        setTrack(element, () => {
            lgSa.platTrack('h5click', {
                page_id: '1rxs',
                address_id: '1ry6',
                type: i === 2 ? 4 : i + 1
            });
            setTimeout(() => {
                document.querySelectorAll('.share-content .cancel')[0].click()
            }, 1000)
        })
    }
    setTrack(document.querySelectorAll('.share-content .cancel')[0], () => {
        lgSa.platTrack('h5click', {
            page_id: '1rxs',
            address_id: '1ry6',
            type: 0
        });
    })
}
